Campeona del @puntadelobospro 🏆 !!! 

Este campeonato lo surfie con todo mi corazón lo que me hizo disfrutar cada momento ❤️ agradeciendo a Punta de lobos en todos mis heats por el increíble año que me dio. Ganar en mi casa era una meta qué realmente quería cumplir 🥹! las olas estuvieron pequeñas así que estoy feliz de demostrar que en esas condiciones también puedo 💪🏼 felicitaciones a mis amigas @iessicaa @jovidueira @cataescobard y a todas y todos los competidores ! 

Muchas gracias a mi familia, amigos, a los organizadores y a toda la gente que estuvo siguiendo el campeonato. Fue un gran evento y espero sigan haciendo muchos más asi 🙌🏼🇨🇱

Acabo de aterrizar en Hawaii y cumplir otro de mis sueños !!! El verano pasado trabaje pensando en este viaje, todo un año preparando y entrenando fuerte y aun que hubieron muchos altos y bajos lo logramos 🙏🏼.
Dar las gracias a @un.mar.de.colores por que ellos creyeron en mi sin dudar y me otorgaron una beca de surfista que me ayuda muchísimo a que pueda estar aquí ahora ! 🙌🏼 espero aprender mucho 🌺🌊

Una semana muy linda llena de emociones ✨ ahora estoy muertaaa 😅💤

Muchas gracias a mis auspiciadores y a todos los que me apoyan siempre 🙏🏼 vamos x más 

